(2000000763, '...to create a fund for the purchase of hair gel? I like my hair the way it is, thanks!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2000000764, '...as a deserter, you''ll enjoy activities like tethered swimming and dog grooming? How ridiculous!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2000000766, '...the deserters seek a Theramore where citizens will be free to juggle at all hours of the day? What is this nonsense?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2000000767, 'That''s the funniest thing I''ve read in a long time. You''ve just made my day!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2000000768, 'This... this is a joke, right?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2000000765, 'I''d never join anything like this. Better keep this, though. It''ll come in handy in the privy...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
